INSERT INTO `books` (`id`, `book_title`, `book_director_author_artist`, `book_edition`, `book_publisher`, `book_publish_date`, `book_binding`, `book_page`, `book_language`, `book_description`, `book_isbn10`, `book_isbn13`, `book_image`) VALUES
(8, 'Financial Statements: A Step-by-Step Guide to Understanding and Creating Financial Reports', 'Thomas R. Ittelson', '	\nRev Exp', '	\nCareer Pr Inc', '2014-01-23', 'Hardcover', '976', 'English', 'Now the best-selling book of its kind has gotten even better. This revised and expanded second edition of Ittelson''s master work will give you that firm grasp of "the numbers" necessary for business s \nccess. With more than 100,000 copies in print, Financial Statements is a perfect introduction to financial accounting for non-financial managers, stock-market investors, undergraduate business and MBA students, lawyers, lenders, entrepreneurs, and more. Most introductory finance and accounting books fail either because they are written "by accountants for accountants" or the authors dumb down the concepts until they are virtually useless. Financial Statements deftly shows that all this accounting and financial-reporting stuff is not rocket science and that you can understand it! Ittelson empowers non-financial managers by clearly and simply demonstrating how the balance sheet, income statement and cash flow statement work together to offer a snapshot of any company''s financial health.', '1601630239', '9781601630230', '/../web/bookImages/2016-01-05_06_29_11_17025756.png'),
(17, 'Warren Buffett Accounting Book: Reading Financial Statements for Value Investing', 'Roger Pressman', '8', 'McGraw-Hill Education', '2014-01-23', 'Hardcover', '976', 'English', 'For almost three decades, Roger Pressman''s <i> Software Engineering: A Practitioner''s Approach</i> has been the world''s leading textbook in software engineering. The new eighth edition represents a major restructuring and update of previous editions, solidifying the book''s position as the most comprehensive guide to this important subject.<p>The eighth edition of <i> Software Engineering: A Practitioner''s Approach</i> has been designed to consolidate and restructure the content introduced over the past two editions of the book. The chapter structure will return to a more linear presentation of software engineering topics with a direct emphasis on the major activities that are part of a generic software process. Content will focus on widely used software engineering methods and will de-emphasize or completely eliminate discussion of secondary methods, tools and techniques. The intent is to provide a more targeted, prescriptive, and focused approach, while attempting to maintain SEPA''s reputation as a comprehensive guide to software engineering. <p>The 39 chapters of the eighth edition are organized into five parts - Process, Modeling, Quality Management, Managing Software Projects, and Advanced Topics. The book has been revised and restructured to improve pedagogical flow and emphasize new and important software engineering processes and practices.', '1939370159', '9781939370150', NULL),
(20, 'Software Engineering: A Practitioner''s Approach', 'Roger Pressman', '3', 'McGraw-Hill Education', '2014-01-23', 'Hardcover', '976', 'English', 'For almost three decades, Roger Pressman''s <i> Software Engineering: A Practitioner''s Approach</i> has been the world''s leading textbook in software engineering. The new eighth edition represents a major restructuring and update of previous editions, solidifying the book''s position as the most comprehensive guide to this important subject.<p>The eighth edition of <i> Software Engineering: A Practitioner''s Approach</i> has been designed to consolidate and restructure the content introduced over the past two editions of the book. The chapter structure will return to a more linear presentation of software engineering topics with a direct emphasis on the major activities that are part of a generic software process. Content will focus on widely used software engineering methods and will de-emphasize or completely eliminate discussion of secondary methods, tools and techniques. The intent is to provide a more targeted, prescriptive, and focused approach, while attempting to maintain SEPA''s reputation as a comprehensive guide to software engineering. <p>The 39 chapters of the eighth edition are organized into five parts - Process, Modeling, Quality Management, Managing Software Projects, and Advanced Topics. The book has been revised and restructured to improve pedagogical flow and emphasize new and important software engineering processes and practices.', '0078022126', '9780078022128', NULL),
(23, 'Growth Hacker Marketing: A Primer on the Future of PR, Marketing, and Advertising', 'Ryan Holiday', 'Reprint', 'Portfolio', '2014-09-30', 'Paperback', '144', NULL, '<b>A Primer on the Future of PR, Marketing and Advertising</b><br><br>A new generation of megabrands like Facebook, Dropbox, Airbnb, and Twitter haven’t spent a dime on traditional marketing. No press releases, no TV commercials, no billboards. Instead, they rely on a new strategy—growth hacking—to reach many more people despite modest marketing budgets. Growth hackers have thrown out the old playbook and replaced it with tools that are testable, trackable, and scalable. They believe that products and businesses should be modified repeatedly until they’re primed to generate explosive reactions.<p><br>Bestselling author Ryan Holiday, the acclaimed marketing guru for American Apparel and many bestselling authors and multiplatinum musicians, explains the new rules and provides valuable examples and case studies for aspiring growth hackers. Whether you work for a tiny start-up or a Fortune 500 giant, if you’re responsible for building awareness and buzz for a product or service, this is your road map.</p>', '1591847389', '9781591847380', '/../web/bookImages/2016-27-04_09_19_25_79968261.png'),
(24, 'Do It! Marketing: 77 Instant-Action Ideas to Boost Sales, Maximize Profits, and Crush Your Competition', 'David Newman', '5.6.2013', 'AMACOM', '2013-06-05', 'Hardcover', '288', NULL, '<div><b>As a small-business owner or solopreneur, you wear many hats--perhaps the most important of which is marketer.</b> </div><br><div><b>But these days, with so many new ways to reach customers and clients</b> -- and only so much time in the day -- it''s hard to know where to start. Should you be using social media? Email? Blogs? Video? SEO? </div><br><div><b>Small business marketing doesn''t have to be a mystery.</b> It''s just a series of simple decisions (and the action steps to implement those decisions) that will help you regain the clarity, confidence, and control you need to succeed.</div><div></div><br><div><b>Do It! Marketing is a quick read and an encouraging kick in the pants</b> that will reignite your marketing mojo. The underlying premise is that ''only action creates results.'' <br><br><b>Packed with do-this-now ideas to attract, engage, and win more customers and clients</b>, this no-nonsense book reveals how to: <ul><li>Avoid blah, blah, blah marketing </li><li>Use magnetic marketing strategies that pull (not push) qualified prospects into your world </li><li>Get noticed using the power of 3PR</li><li>Position yourself as the go-to expert in your field</li><li>Become the obvious choice by building your Thought Leadership Platform</li><li>Do social media right </li><li>Zero in on your customers'' pain/gain factors </li><li>Learn to speak prospect language about prospect problems </li><li>Generate a steady stream of referrals </li><li>Identify and focus on high-payoff marketing activities </li><li>Gain clarity, confidence and control so you sell more - more easily and more often</li><li>Cultivate and leverage enthusiastic advocates </li><li>And more </li></ul><b> Energetic, inspiring, and filled with concrete strategies, tactics, templates, and tools</b>, Do It! Marketing shows you how to stop ''marketing by accident'' and start outsmarting, out-positioning, and out-executing the competition.</div>', '0814432867', '9780814432860', '/../web/bookImages/2016-27-04_09_20_00_60464477.png'),
(25, 'Go Pro: 7 Steps to Becoming a Network Marketing Professional', 'Eric Worre', 'First Printing!', 'Network Marketing Pro Inc.', '2013-05-01', 'Paperback', '160', NULL, 'Over twenty years ago at a company convention, Eric Worre had an aha moment that changed his life forever. At that event he made the decision to Go Pro and become a Network Marketing expert. Since that time, he has focused on developing the skills to do just that. In doing so, Eric has touched and been touched by hundreds of thousands of people around the world. Now he shares his wisdom in a guide that will ignite your passion for this profession and help you make the decision to Go Pro and create the life of your dreams. <b>In this definitive guidebook, you will learn to:</b> -Find prospects -Invite them to your product or opportunity -Present your product -Follow up with your prospects -Help them become customers or distributors -Help them get started right -Grow your team by promoting events -And much, much more. Eric''s wish is for you to make the decision to become a Network Marketing Professional. For you to truly Go Pro. Because it is a stone-cold fact that Network Marketing is a better way. Now let''s go tell the world.', '0988667908', '9780988667907', '/../web/bookImages/2016-27-04_10_17_02_4171752.png'),
(26, 'The Marketing Blueprint: Lessons to Market & Sell Anything', 'Jules Marcoux', NULL, 'CreateSpace Independent Publishing Platform', '2015-06-25', 'Paperback', '198', NULL, 'Are you an entrepreneur, marketing director or CEO looking to take your brand to the next level, without spending millions of dollars? Are you a marketer, working for yourself, or a brand, and want to improve your skills to get better results? Are you a marketing student that wants a competitive edge over his or her peers? Or, are you someone who simply wants to improve their personal brand, in order to obtain better job opportunities? Forget the old marketing textbooks that spew endless theories at you, without tangible examples to use them in. Whether your goal is to grow one of your side projects into a marketable business, to improve the revenues of your current brand, or to better the brand of the company you work for, The Marketing Blueprint is what you need. <div></div><div> This step-by-step guide compiles all essential marketing strategies, such as: </div><div><br><div></div><div> * How to market, from forming marketing strategies, to business development, to improving your selling skills </div><div>* How to become a more efficient marketer, by understanding and using leverage effectively </div><div>* How to market yourself and your brand''s people, to ensure better business opportunities </div><div>* How to create brands and products that make people talk and stay relevant for years </div><div></div><div></div><div></div><div>To top it all off, this book has more than 30 lessons of practical content that you can use right away in your business. Longer hours and bigger textbooks aren''t the answer to your success. By being the smartest marketer around, you can ensure you will grow your business'' revenues. </div><div></div><div></div><div>That''s exactly what The Marketing Blueprint is all about.            </div></div>', '1514625768', '9781514625767', '/../web/bookImages/2016-27-04_10_56_32_69271850.png'),
(27, 'Everybody Writes: Your Go-To Guide to Creating Ridiculously Good Content', 'Ann Handley', '1', 'Wiley', '2014-09-15', 'Hardcover', '320', NULL, '<b><i>Finally a go-to guide to creating and publishing the kind of content that will make your business thrive.</i></b>  <p><i>Everybody Writes</i> is a go-to guide to attracting and retaining customers through stellar online communication, because in our content-driven world, every one of us is, in fact, a writer.</p> <p>If you have a web site, you are a publisher. If you are on social media, you are in marketing. And that means that we are all relying on our words to carry our marketing messages. We are all writers.</p> <p>Yeah, but who cares about writing anymore? In a time-challenged world dominated by short and snappy, by click-bait headlines and Twitter streams and Instagram feeds and gifs and video and Snapchat and YOLO and LOL and #tbt. . . does the idea of focusing on writing seem pedantic and ordinary?</p> <p>Actually, writing matters more now, not less. Our online words are our currency; they tell our customers who we are.</p> <p>Our writing can make us look smart or it can make us look stupid. It can make us seem fun, or warm, or competent, or trustworthy. But it can also make us seem humdrum or discombobulated or flat-out boring.</p> <p>That means you''ve got to choose words well, and write with economy and the style and honest empathy for your customers. And it means you put a new value on an often-overlooked skill in content marketing: How to write, and how to tell a true story really, really well. That''s true whether you''re writing a listicle or the words on a Slideshare deck or the words you''re reading right here, right now...</p> <p>And so being able to communicate well in writing isn''t just nice; it''s necessity. And it''s also the oft-overlooked cornerstone of nearly all our content marketing.</p> <p>In <i>Everybody Writes</i>, top marketing veteran Ann Handley gives expert guidance and insight into the process and strategy of content creation, production and publishing, with actionable how-to advice designed to get results.</p> <p>These lessons and rules apply across all of your online assets — like web pages, home page, landing pages, blogs, email, marketing offers, and on Facebook, Twitter, LinkedIn, and other social media. Ann deconstructs the strategy and delivers a practical approach to create ridiculously compelling and competent content. It''s designed to be the go-to guide for anyone creating or publishing any kind of online content — whether you''re a big brand or you''re small and solo.</p> <p>Sections include:</p> <ul> <li>How to write better. (Or, for ''adult-onset writers'': How to hate writing less.)</li> <li>Easy grammar and usage rules tailored for business in a fun, memorable way. (Enough to keep you looking sharp, but not too much to overwhelm you.)</li> <li>Giving your audience the gift of your true story, told well. Empathy and humanity and inspiration are key here, so the book covers that, too.</li> <li>Best practices for creating credible, trustworthy content steeped in some time-honored rules of solid journalism. Because publishing content and talking directly to your customers is, at its heart, a privilege.</li> <li>''Things Marketers Write'': The fundamentals of 17 specific kinds of content that marketers are often tasked with crafting.</li> <li>Content Tools: The sharpest tools you need to get the job done.</li> </ul> <p>Traditional marketing techniques are no longer enough. <i>Everybody Writes</i> is a field guide for the smartest businesses who know that great content is the key to thriving in this digital world.</p>', '1118905555', '9781118905555', 'http://ecx.images-amazon.com/images/I/418DnZHrHlL.jpg'),
(29, 'SEO 2016 Learn Search Engine Optimization  With Smart Internet Marketing Strategies: Learn SEO with smart internet marketing strategies', 'Adam Clarke', 'Exp Upd', 'CreateSpace Independent Publishing Platform', '2015-08-03', 'Paperback', '188', NULL, '<h2>Learn SEO strategies to rank at the top of Google with SEO 2016</h2><br> <b>EXPANDED & UPDATED - APRIL, 2016</b><br><br> No matter your background, SEO 2016 will walk you through search engine optimization techniques used to grow countless companies online, exact steps to rank high in Google, and how get a ton of customers with SEO. First, let me tell you a little secret about SEO marketing...<br><br> <h3>Most of the search engine optimization advice on the Internet is wrong!</h3><br> If you''ve sifted through the torrents of search engine optimization advice online, you may have noticed two things:<br> <p>- Most published SEO advice is either outdated or just dead-wrong.<br> - Google''s constant updates have made many popular SEO optimization strategies useless.<br> Why is this so? Google are constantly evolving, making it extremely difficult to know what works. Recent changes:<br></p> <p>1. March, 2016 - Google announce a second mobile update, further decreasing rankings for sites that don''t support mobile devices.<br> 2. February, 2016 - Google announces their support for the new groundbreaking technology HTTP/2 that can almost double the loading speed of your website.<br> 3. October, 2015 - Google announces RankBrain, their innovative machine learning technology that has been secretly influencing the search results.<br><br> SEO 2016 is now updated covering the latest changes to Google''s algorithm, and walks you through all major updates and how to use them to your advantage. This book also reveals industry secrets about staying ahead of Google''s algorithm, and what potential Google changes may be coming up in 2016. With this best-selling SEO book you can learn SEO from a fundamental level, achieve top rankings, and generate a wave of new customers to your site.<br></p> <h3>Discover powerful link building techniques experts use to get top rankings and generate massive traffic</h3><br> Link building is the strongest factor for ranking high in Google. Unfortunately, most widely-used methods suck! This chapter walks you through new and powerful techniques that won''t get you in hot-water with Google. Now expanded and updated with more link building strategies, and extra tips for advanced readers.<br><br> <b>You will also discover:</b> <p>1. Important SEO concepts, from beginner to advanced.<br> 2. Sneaky tricks to get local businesses ranking high with local SEO.<br> 3. How to find ''money'' keywords that will send customers to your site.<br> 4. Six insider sources to get expert SEO or Internet marketing advice worth thousands of dollars, for free.<br></p> <h3>Also discover little-known search engine optimization tools top Internet marketing experts use</h3><br> The SEO tools chapter lists 25+ powerful tools top Internet marketing experts use to automate their search engine optimization, saving weeks of time, and creating bigger results... and most of the tools are free!<br><br> <h3>Sidestep the 2016 Google updates</h3><br> Contrary to Internet marketing gossip, problems caused by Google updates are rarely irrecoverable—but you need the right knowledge. This book reveals:<br> <p>- The inner mechanics of Google''s algorithm, and how to use them to rank your site at the top.<br> - 2015 and 2016 Google updates—HTTPS, RankBrain, HTTP/2, Adpocalypse, Penguin 4.0 and more.<br> - Potential updates coming up in 2016 and 2017.<br> - Steps to recover from a Google penalty.<br></p> <h3>And read the very special bonus chapter on pay-per-click advertising</h3><br> In this special bonus, learn to quickly and effectively setup pay-per-click advertising campaigns with Google AdWords, and send more customers to your website overnight, literally.<br><br> <b>This is one of the most advanced and comprehensive SEO optimization books ever published—now updated and expanded—of all best-selling SEO books, this is the only one with everything you need.</b><br><br><b>Scroll up, click buy, and get started now!</b>', '151534567X', '9781515345671', '/../web/bookImages/2016-27-04_11_30_32_45407104.png'),
(37, 'The Art of Social Media: Power Tips for Power Users', 'Guy Kawasaki', NULL, 'Portfolio', '2014-12-04', 'Hardcover', '208', NULL, 'By now it''s clear that whether you''re promoting a business, a product, or yourself, social media is near the top of what determines your success or failure. And there are countless pundits, authors, and consultants eager to advise you.<p><br>But there’s no one quite like Guy Kawasaki, the legendary former chief evangelist for Apple and one of the pioneers of business blogging, tweeting, Facebooking, Tumbling, and much, much more. Now Guy has teamed up with Peg Fitzpatrick, who he says is the best social-media person he’s ever met, to offer <i>The Art of Social Media</i>—the one essential guide you need to get the most bang for your time, effort, and money.</p><p><br>With over one hundred practical tips, tricks, and insights, Guy and Peg present a bottom-up strategy to produce a focused, thorough, and compelling presence on the most popular social-media platforms. They guide you through steps to build your foundation, amass your digital assets, optimize your profile, attract more followers, and effectively integrate social media and blogging.</p><p><br>For beginners overwhelmed by too many choices as well as seasoned professionals eager to improve their game, <i>The Art of Social Media</i> is full of tactics that have been proven to work in the real world. Or as Guy puts it, “great stuff, no fluff.”</p>', '1591848075', '9781591848073', '/../web/bookImages/2016-27-04_12_39_48_2960205.png'),
(41, 'TITITIT', 'sujit', '3', 'sujit', '2016-04-09', 'Hardcover', NULL, NULL, NULL, '15918480752334', '1591848075233411111111', '/../web/bookImages/2016-27-04_12_49_48_30139160.png'),
(42, 'Marketing 2014', 'William M. Pride', '17', 'South-Western College Pub', '2013-01-10', 'Paperback', '832', NULL, 'Perfect for students of all backgrounds and interest levels, Pride and Ferrell''s MARKETING 2014 combines a thorough overview of essential marketing principles with a visually engaging, reader-friendly presentation. This popular, proven text and a full range of supplemental learning resources (including eLectures, videos, and an interactive marketing plan) provide students with the knowledge and decision-making skills they''ll need to succeed in today''s competitive business environment. MARKETING 2014 includes the most current coverage of marketing strategies and concepts with extensive real-world examples including material on social networking and digital marketing. This edition has a new chapter on digital media and social networking that incorporates the latest research and trends in the ever-changing environment of e-marketing. You will find important topics drawn from the rapidly changing world of modern business including social and environmental responsibility, sustainability, globalization, entrepreneurship, and marketing through transitional times.   Available with InfoTrac Student Collections http://gocengage.com/infotrac.', '1133939252', '9781133939252', '/../web/bookImages/2016-27-04_12_52_14_23837280.png'),
(45, 'The New Rules of Marketing and PR: How to Use Social Media, Online Video, Mobile Applications, Blogs, News Releases, and Viral Marketing to Reach Buyers Directly', 'David Meerman Scott', '5', 'Wiley', '2015-10-05', 'Paperback', '480', NULL, 'The most updated edition yet of the benchmark guide to marketing and PR, with the latest social media, marketing, and sales trends, tools, and real-world examples of success This is the fifth edition of the pioneering guide to the future of marketing. The New Rules of Marketing & PR is an international bestseller with more than 350,000 copies sold in over twenty-five languages. It offers a step-by-step action plan for harnessing the power of modern marketing and PR to directly communicate with buyers, raise visibility, and increase sales. This practical guide is written for marketing professionals, PR professionals, and entrepreneurs who want to grow their businesses and create success. Learn how companies, nonprofits, and organizations of all sizes can leverage web-based content to get timely, relevant information to eager, responsive buyers for a fraction of the cost of big-budget campaigns. This fifth edition—the most extensively revised edition yet—includes:  Dozens of compelling case studies with revisions Real-world examples of content marketing and inbound marketing strategies and tactics A fresh introduction A new chapter on sales and service Coverage of the latest social media platforms, including Periscope, Meerkat, and Snapchat  The New Rules of Marketing & PR is an unparalleled resource for entrepreneurs, business owners, nonprofit managers, and all of those working in marketing or publicity departments. This practical guide shows how to devise successful marketing and PR strategies to grow any business.David Meerman Scott is a marketing strategist, bestselling author of ten books—including three international bestsellers—advisor to emerging companies such as HubSpot, and a professional speaker on marketing, leadership, and social media. Prior to starting his own business, he was marketing VP for two publicly traded US companies and was Asia marketing director for Knight-Ridder, at the time one of the world''s largest information companies.', '1119070481', '9781119070481', '/../web/bookImages/2016-02-05_08_55_04_58102416.png'),
(46, 'SEO Fitness Workbook, 2016 Edition: The Seven Steps to Search Engine Optimization Success on Google', 'Jason McDonald Ph.D.', 'Workbook', 'CreateSpace Independent Publishing Platform', '2015-11-25', 'Paperback', '158', NULL, 'SEO Made EASY: Step-by-step Directions to the Top of Google  2016 Updated Edition - up-to-date coverage of Google''s Penguin, Panda, Semantic Search, Mobile and even Local algorithm updates FREE SEO Tools - includes access to Jason''s SEO Toolbook - a $29.99 value! Worksheets and Videos - more than just a book, the SEO Fitness Workbook includes worksheets and videos to guide you from SEO novice to SEO expert. Contents - coverage of ''On Page'' and ''Off Page'' SEO, the ''new'' content marketing, blogging, link-building and every other esoteric technical tactic in PLAIN ENGLISH for MERE MORTALS   SEO in PLAIN ENGLISH: let Jason guide you in SIMPLE language to the top of Google, Bing, and Yahoo     More on the SEO FITNESS WORKBOOK, 2016 Edition   While many books on SEO sell for $2.99 or are even free, the SEO FITNESS WORKBOOK is priced at around $39.99. It''s worth it. Here''s why -    Please ''Look inside'' other books on SEO on Amazon, and PLEASE read the reviews! Compare the reviews of those books with the reviews of the SEO FITNESS WORKBOOK. Many of the books on Amazon, unfortunately, are just junk put up quickly to make a quick buck. The SEO Fitness Workbook, in contrast, is built upon years of real experience, and the teaching methodology of Jason McDonald, used in his classes in the San Francisco Bay Area, including Stanford University''s Continuing Studies program. It''s in-depth, and supported by facts and real experience.  Got questions? Google Jason McDonald and send an email. Simple STEP-BY-STEP instructions PLUS free tools PLUS worksheets PLUS videos makes the SEO FITNESS WORKBOOK worth $50 or even $75 dollars, easily.    The author, Jason McDonald, has instructed thousands of people in his classes in the San Francisco Bay Area, including Stanford Continuing Studies, as well as online. Jason speaks in simple English and uses the metaphor of “The Seven Steps to SEO Fitness” to explain to you how to ''get SEO fit.''    Check out the other SEO Books - SEO For Dummies, SEO an Hour a Day, etc., - they''re great, they''re good, but they don''t include powerful step-by-step worksheets, links to online videos, and the free SEO Toolbook with hundreds of free tools for search engine optimization 2015. Buy the ''free'' or .99 cent books on search engine optimization, and compare them with the SEO FITNESS WORKBOOK. You get what you pay for.', '1518748880', '9781518748882', '/../web/bookImages/2016-02-05_11_21_02_59899902.png');
